import React from 'react';
import {Button,Block} from "components";

import './Auth.scss'
const Auth = () => (
    
        <section className="auth">
            <Block>
                <Button className="button__large" type="primary" size="large">
                    This is button
                </Button>
            </Block>
        </section>
    );

export default Auth;
